        private void LoadClockHTML()
        {
            string clockHtml = @"<!doctype html>
            <!DOCTYPE html> 
            <html> 
              <head> 
                <meta http-equiv='X-UA-Compatible' content='IE=edge'> 
             </head>
            <body>
            <div id='clock'>
                <div id='hour'></div>
                <div id='minute'></div>
                <div id='second'></div>
            </div>
            <style>
                #clock {
                background: url('data:image/bmp;base64,') no-repeat;
                width: 128px;
                height: 128px;
                }
                #clock {
                  position: absolute;
                  bottom: 0;
                  left: 0;
                }
                * {overflow: hidden;margin:0;padding:0}
                
                #hour,
                #minute,
                #second {
                position: absolute;
                background: black;
                border-radius: 10px;
                transform-origin: bottom;
                transform: rotate(45deg);
                }
                
                #hour {
                width: 1.6%;
                height: 25%;
                top: 25%;
                left: 48.85%;
                opacity: 0.8;
                }
                
                #minute {
                width: 1.6%;
                height: 30%;
                top: 19%;
                left: 48.9%;
                opacity: 0.8;
                }
                
                #second {
                width: 1%;
                height: 40%;
                top: 9%;
                left: 49.25%;
                opacity: 0.5;
                }
            </style>
            <script>
                setInterval(function(){
                d = new Date(); //object of date()
                hr = d.getHours();
                min = d.getMinutes();
                sec = d.getSeconds();
